import React from 'react';

const NotFound = () => {
    return (
        <div>
            <div className='text-center mt-5 text-danger'>
                <h1>Ooops!</h1>
                <h3>404-Page Not Found.</h3>
            </div>
        </div>
    );
};

export default NotFound;
